content:
I'll be brutally honest - this material lacks professionalism from almost all sides:
- bad audio quality;
- there is almost no explanation what, how and why things work the way it works;
- sometimes he's stuck at some issues and seems like he's reading from a paper without knowing what's happening with his code.
I would like to encourage this person to prepare more, before making final video cut.

If someone is interested who am I to say that - I am programming myself in Rust and am I teaching others profesionally to code for more than 5 years. ✌

der code zum runterladen war fehlerhaft. Zu beispiel fehlte in der course-card.component.ts die zeile ganz oben mit :
 import { Course } from '../model/course';

Dadurch hatte der rest auch nicht funktioniert und man konne nicht mitarbeiten
